INSERT INTO `organization` VALUES (1,'Department of Computer Science','3101 Dyer Street, Dallas, TX, 75205','Applied Machine Learning, Software Engineering, AI Application Domains','https://www.smu.edu/lyle/departments/cs',NULL,18,'','3101 Dyer Street','','Dallas','TX',75205,'Computer Science at SMU Lyle is a research-oriented, student-centered department. ','We train strong logical thinkers and problem solvers who use computers and computational processes to build solutions that change the world. We promote world-class research with an absolute commitment to excellence in teaching.','CS has identified three research focus areas:  Applied Machine Learning, Software Engineering, AI Application Domains.','Jia Zhang','jiazhang@smu.edu',2147683052,NULL),(2,'Department of Mechanical Engineering','3101 Dyer Street, Dallas, TX, 75205','Energy & Sustainability, Advanced Manufacturing, Thermal Science & Fluid Mechanics, Dynamics Controls, Mechatronics & Robotics, Materials Science & Solid Mechanics, Biosystems','https://www.smu.edu/lyle/departments/me',NULL,0,'','3101 Dyer Street','','Dallas','TX',75205,'Mechanical Engineering provides the technical depth and breadth required for engineers to lead organizations and develop impactful technical solutions in a wide range of industries.','Shape the future in a field where extraordinary advances revolutionize every day life through personal computers, computer-communications networks, integrated circuits, optical technologies, digital signal processors and wireless communications systems.  ','Energy & Sustainability, Advanced Manufacturing, Thermal Science & Fluid Mechanics, Dynamics Controls, Mechatronics & Robotics, Materials Science & Solid Mechanics, Biosystems','Amin Salehi-Khojin','asalehikhojin@mail.smu.edu',2147683050,1),(3,'Department of Electrical and Computer Engineering','3101 Dyer Street, Dallas, TX, 75205','Semiconductors, Biomedical, Autonomous Systems','https://www.smu.edu/lyle/departments/ece',NULL,0,'','3101 Dyer Street','','Dallas','TX',75205,'Electrical and Computer Engineering lies at the core of todays technology-driven society. ','Shape the future in a field where extraordinary advances revolutionize every day life through personal computers, computer-communications networks, integrated circuits, optical technologies, digital signal processors and wireless communications systems.','Semiconductors, Biomedical, Autonomous Systems','Mahesh Krishnamurthy','mkrishnamurthy@mail.smu.edu',2147687045,1),(4,'Department of Operations Research & Engineering Management','3101 Dyer Street, Dallas, TX, 75205','OREM faculty research programs focus on the broad area of advanced analytics with a particular emphasis on operations research (a.k.a., prescriptive analytics) and its applications which are at the core of industrial and systems engineering such as supply chain, healthcare, financial, telecommunications and energy systems, among many others. The unifying theme of these efforts is the application of scientific management and engineering principles and methodologies to enhance system/organizational performance in a variety of practical settings arising in industry, business, government, and non-profit operations.','https://www.smu.edu/lyle/departments/orem',NULL,0,'','3101 Dyer Street','','Dallas','TX',75205,'OREM programs develop leadership, engineering and management skills for success in technology-driven organizations. ','OREM programs develop leadership, engineering and management skills for success in technology-driven organizations. The same systems-oriented, mathematical model-based approach to design  which has been the cornerstone of engineering for decades  has powerful application within technology-driven organizations. ','OREM faculty research programs focus on the broad area of advanced analytics with a particular emphasis on operations research (a.k.a., prescriptive analytics) and its applications which are at the core of industrial and systems engineering such as supply chain, healthcare, financial, telecommunications and energy systems, among many others. The unifying theme of these efforts is the application of scientific management and engineering principles and methodologies to enhance system/organizational performance in a variety of practical settings arising in industry, business, government, and non-profit operations.','Sila Cetinkaya','sila@smu.edu',2147683050,1),(5,'Department of Civil & Environmental Engineering','3101 Dyer Street, Dallas, TX, 75205','Energy and Environment, Global and Sustainable Development, Smart and Resilient Infrastructure','https://www.smu.edu/lyle/departments/cee',NULL,0,'','3101 Dyer Street','','Dallas','TX',75205,'Explore a broad range of studies, including transportation, smart and resilient infrastructure, water quality and earthquake engineering.','The Department of Civil & Environmental Engineering at SMU Lyle performs leading-edge research to expand knowledge and develop new designs and methods to sustain people and nature in natural and built environments.','Our research focal areas span across transportation engineering and planning, structural analysis and design, earthquake engineering, treatment and supply of drinking water, biogeochemical redox processes, mathematical modeling of fate and transport processes in the subsurface, modeling microbial kinetics, quantitative geochemistry, pollution prevention and industrial waste treatment.','Usama El Shamy','uelshamy@smu.edu',2147683124,1),(6,'Statistical Science and Data Science','','','',NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7,'Software engineering','','','',NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(8,'Hart Center for Engineering Leadership','3101 Dyer Street Dallas, TX 75205,','Conducting advanced research in Artificial Intelligence (AI) utilization and wearable technologies in developing effective technical leaders. AI-powered strategies for mitigating burnout and attrition in high-performance workplaces on remote workers using wearable technology. ','https://www.smu.edu/lyle/centers-and-institutes/hart-center-for-engineering-leadership',NULL,0,'','3101 Dyer Street Dallas, TX 75205','','Dallas','TX',75205,'The Hart Center for Engineering Leadership transforms leading engineering students into next-generation technical leaders with the values, attitudes, and skills necessary to understand and address engineering problems.  ','The Hart Center for Engineering Leadership transforms leading engineering students into next-generation technical leaders with the values, attitudes, and skills necessary to understand and address engineering problems.  Our approach is cohort-based and highly interactive, blending engineering scenario practice, emotional intelligence, neuroscience, mindfulness, and personal reflection and values development.','AI','Ben Zoghi','bzoghi@smu.edu',2147687046,1),(9,'Network Engineering','','','',NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(10,'cs','','','',NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
