INSERT INTO `rajob` VALUES (4,'True',NULL,'closed','Project assist','Support Prof. Camp working with Company A',0,0,2,'Computer Science at SMU Lyle is a research-oriented, student-centered department. ','We train strong logical thinkers and problem solvers who use computers and computational processes to build solutions that change the world. We promote world-class research with an absolute commitment to excellence in teaching.','CS has identified three research focus areas:  Applied Machine Learning, Software Engineering, AI Application Domains.','','','','','https://www.smu.edu/lyle/departments/orem','Electrical and Computer Engineering','Company A and Prof. Camp\'s office','Excellent project management skills, Electrical Engineering major','Master of Electrical Engineering','','','',20,0,'Sun Feb 02 15:37:22 CST 2025','Sun Feb 02 15:37:22 CST 2025'),(5,'True',NULL,'closed','Project assist ONE','Support Prof. Camp working with Company A',0,0,1,'Computer Science at SMU Lyle is a research-oriented, student-centered department. ','','CS has identified three research focus areas:  Applied Machine Learning, Software Engineering, AI Application Domains.','','','','','https://www.smu.edu/lyle/departments/orem','Electrical and Computer Engineering','Company A and Prof. Camp\'s office','Excellent project management skills, Electrical Engineering major','Master of Electrical Engineering','','','',1,0,'Mon Feb 03 15:05:34 CST 2025','Mon Feb 03 15:05:34 CST 2025'),(6,'True',NULL,'closed','TESTRAJOB3','TESTRAJOB3',0,0,2,'TESTRAJOB3','','SAAS','','','','','','Computer Science','distance','TESTRAJOB3','TESTRAJOB3','','','',20,0,'Sun Feb 09 17:00:48 UTC 2025','Sun Feb 09 17:00:48 UTC 2025'),(7,'True',NULL,'open','CyberDefender','Train AI to Become a Cyber Defender via a Comprehensive Software/Hardware Vulnerability Knowledge Base',0,0,1,'Train AI to Become a Cyber Defender via a Comprehensive Software/Hardware Vulnerability Knowledge Base','This project tackles the pressing issue of cyber vulnerabilities in U.S. computer software and hardware systems. \r\n1. Motivation of the research project \r\nThis project tackles the pressing issue of cyber vulnerabilities in U.S. computer software and hardware systems. Despite extensive efforts from national agencies, companies, and the cybersecurity research community, current automated tools fail to identify and address system flaws comprehensively. The problem lies in their narrow focus on isolated aspects, such as source code, hindering a holistic understanding of vulnerabilities and their fixes. The escalating frequency of cyberattacks, leading to data breaches and disruptive incidents like the Colonial Pipeline ransomware attack, highlights the situation\'s urgency. In addition, traditional tools often miss vulnerabilities spanning both hardware and software, as exemplified by the SPECTRE and Meltdown attacks that take advantage of speculative execution. This underscores the need for collective analysis of the entire system. Rather than analyzing isolated aspects (e.g., source code), this research seeks to fill this gap by adopting a holistic approach to consolidate scattered knowledge in natural language software system artifacts and hardware specifications that explain the root causes of vulnerability, crash locations, and how to fix it. However, manually locating the vast amounts of scattered knowledge and reasoning about their relationship with source code changes is extremely effort-consuming and usually limited or even biased by human perception and experience. Our goal is to train AI to understand the causes, crash phenomena, and fixes of existing vulnerabilities described in natural language artifacts, and to locate and reason about the corresponding patterns of triggers, crashes, and fixes in source code. Developing such a holistic view of vulnerability enables AI to assist cybersecurity experts to effectively and efficiently predict and prevent future vulnerabilities. Emphasizing the significance of vulnerability detection, the project aims to unveil potential avenues of exploitation before attacks occur. The proposed research plans to create a comprehensive knowledge base encompassing natural language software artifacts and hardware specifications, source code, and program analysis results. This knowledge base will also correlate software actions with their impact on underlying hardware during past attacks. Leveraging machine/deep learning, Natural Language Processing (NLP) techniques, and knowledge graphs, the project aims to represent and visualize this knowledge.  \r\n\r\n2. Expected outcomes \r\nThe resulting insights will serve as the foundation for new vulnerability detection and repair techniques, addressing the root causes of cyberattacks across all aspects of the system. We will develop an automated toolchain and data repository that makes the research outcomes and experiment results easily accessible and usable by government agencies and industrial organizations. The outcome will free these systems of specific vulnerabilities, making it impossible for attackers to exploit them. We expect that our proposed techniques will prevent at least 50% of the millions of cyberattacks from happening, especially those targeting government \r\ninfrastructures. \r\n\r\n3. Intended techniques/methodologies \r\n Combine the power of NLP and traditional software engineering techniques (e.g., static analysis) to locate and reason about the traceability links among natural language artifacts (e.g., vulnerability reports, bug reports, commit messages, pull requests, in-line code comments, etc.), source code, execution logs, program analysis results of code artifacts (e.g., vulnerability fixes, code structures, and dependencies), and hardware specifications. We propose a novel relational traceability model that can trace between a pair of related Natural Language vulnerability entities (trigger, crash phenomenon, and fix) and their corresponding source lines of code. \r\n Leveraging manually discovered heuristic patterns, machine/deep learning models, and large language models (LLMs), we can train AI to learn the patterns of triggers, crash phenomena and locations, and fixes of vulnerability to build the nations first comprehensive vulnerability knowledge base that recovers and consolidates the traced knowledge from both software and hardware repositories.  \r\n Correlate software vulnerabilities to the underlying hardware so that alternative sources of information or control can be exposed. For example, some attacks obtain information about memory contents by measuring the time required to access various memory addresses during the attack. Once the interaction between hardware and software is analyzed, failsafe mechanisms and countermeasures to mitigate such attacks can be designed.  \r\n Apply the vulnerability trigger, crash, and fix patterns to analyze critical software and hardware systems and libraries to detect and fix exploitable vulnerabilities.  \r\n\r\n4. Plan for external research grant application \r\nThe preliminary results and publication of the study will enable us to submit a collaborative SMALL Project proposal to the NSF CISE CCF Core Program.','AI, ML,NLP','','','','','','Computer Science','SMU','ML','NLP','','','',9,0,'Sun Feb 09 17:06:29 UTC 2025','Sun Feb 09 17:33:01 UTC 2025'),(8,'True',NULL,'closed','HowtoPostRAJob','HowtoPostRAJob',0,0,1,'HowtoPostRAJob','HowtoPostRAJob','HowtoPostRAJob','','','','','','HowtoPostRAJob','HowtoPostRAJob','HowtoPostRAJob','HowtoPostRAJob','','','',20,0,'Tue Feb 18 22:13:13 UTC 2025','Tue Feb 18 22:13:13 UTC 2025'),(9,'True',NULL,'open','Graduate Research Position','We\'re looking for proficiency in Swift Ul (iOS Development), experience with AWS Cloud Services, Knowledge of Machine Learning, and familiarity with Speech Recognition, NLP, and Data Analysis. ',0,0,1,'We\'re looking for proficiency in Swift Ul (iOS Development), experience with AWS Cloud Services, Knowledge of Machine Learning, and familiarity with Speech Recognition, NLP, and Data Analysis. ','1. What We\'re Looking For:\r\n1). Proficiency in SwiftUl (iOS Development) \r\n2). Experience with AWS Cloud Services \r\n3). Knowledge of Machine Learning\r\n4). Familiarity with Speech Recognition, NLP, and Data Analysis. \r\n\r\n2. Benefits:\r\n1) Work on a meaningful project improving interventions for children with autism and neurological disorders.\r\n2) Collaborate with experts in AI, behavioral science, and app development.\r\n3) Receive a competitive stipend. \r\n\r\n3. How To Apply:\r\nSend your Resume and Cover Letter to Dr. Adel Alaeddini at aalaeddini@smu.edu.\r\nInclude a short message on why we should hire you!  APPLY NOW\r\n','UI, AWS, ML, NLP, DA','','','','','','CENTER FOR DIGITAL AND HUMAN-AUGMENTED MANUFACTURING','on campus','Proficiency in Swift Ul (iOS Development), experience with AWS Cloud Services, Knowledge of Machine Learning, and familiarity with Speech Recognition, NLP, and Data Analysis. ','Proficiency in Swift UI (iOS Development), experience with AWS Cloud Services, Knowledge of Machine Learning, and familiarity with Speech Recognition, NLP, and Data Analysis. ','','','',3,0,'Fri Mar 07 17:24:18 UTC 2025','Fri Mar 07 17:24:18 UTC 2025'),(10,'True',NULL,'updated','Software Developer','We call for talented graduate students to contribute to SMU-Lyle-Sci-Hub program. ',0,0,1,'CS Department developed an SMU-Lyle-Sci-Hub web portal to support scientific/business collaboration, knowledge sharing, and research between SMU and the local industry in the Dallas-Fort Worth Metropolitan Area. ','[Backgroud]\r\nCS Department is developing an SMU-Lyle-Sci-Hub web portal to link SMU with the local industry. Sci-Hub is powered by the most recent computer science techniques, including machine learning/deep learning, artificial intelligence, data mining, knowledge graph, semantic web, natural language processing, cloud computing, and software engineering techniques. Version 1.0 is going live at AWS. This portal is sponsored and supported by Lyle, and ODonnell Data Science and Research Computing Institute. With this platform, CS Department will glue all SMU departments together.\r\n\r\n[Goals]\r\nWe call for talented graduate students to contribute to this exciting project. \r\n\r\n[Requirements]\r\n1. Java (or Python) programming skills are required. \r\n2. JavaScript will be usedif you don\'t know JavaScript, you will soon learn it with our numerous code samples.\r\n\r\nWe may recruit students through RAship ($20/hour, 10 hours/week) .\r\n\r\n','SE, CS, AWS','','','','','','Computer Science','on campus','Java (or Python) programming skills; JavaScript will be usedif you don\'t know JavaScript, you will soon learn it with our numerous code samples.','Java (or Python), JavaScript, GitHub, MySQL,AWS','','','',1,0,'Fri Mar 14 21:15:12 UTC 2025','Tue May 27 04:20:39 UTC 2025'),(11,'True',NULL,'closed','Project assist ONE','Support Prof. Camp working with Company A',0,0,1,'Computer Science at SMU Lyle is a research-oriented, student-centered department. ','','CS has identified three research focus areas:  Applied Machine Learning, Software Engineering, AI Application Domains.','','','','','https://www.smu.edu/lyle/departments/orem','Electrical and Computer Engineering','Company A and Prof. Camp\'s office','Excellent project management skills, Electrical Engineering major','Master of Electrical Engineering','','','',50,0,'Wed Mar 19 14:53:17 CDT 2025','Wed Mar 19 14:53:17 CDT 2025'),(12,'True',NULL,'closed','Project assist ONE','Support Prof. Camp working with Company A',0,0,1,'CS Department developed an SMU-Lyle-Sci-Hub web portal to support scientific/business collaboration, knowledge sharing, and research between SMU and the local industry in the Dallas-Fort Worth Metropolitan Area. ','','SE, CS, AWS','','','','','','Computer Science','on campus','Java (or Python) programming skills; JavaScript will be usedif you don\'t know JavaScript, you will soon learn it with our numerous code samples.','Java (or Python), JavaScript, GitHub, MySQL,AWS','','','',20,0,'Wed Mar 19 19:55:12 UTC 2025','Wed Mar 19 19:55:12 UTC 2025'),(13,'True',NULL,'closed','Test RA Job1','RA',0,0,1,'RA','RA','CS, ML','','','','','http://test.com','CS','SMU','ML','AI','','','',1,0,'Fri May 16 18:52:54 UTC 2025','Fri May 16 18:52:54 UTC 2025'),(14,'True',NULL,'updated','Summer RA for WECAN','The selected research assistant will engage in SMUs Summer Research Intensive, gaining experience in interdisciplinary research, software development, community engagement, and professional communication through workshops and formal presentations.',0,0,1,'This position supports the development of the WECAN Toolkit (Wellbeing Enhancement through Crowd-sourced Assessment of Neighborhood-infrastructure), a CEE-led initiative focused on participatory infrastructure planning and wellbeing analysis.','We are seeking a highly motivated research assistant to join the WECAN project as part of SMUs Summer Research Intensive. This opportunity includes participation in workshops, professional development activities, and a final research presentation.\r\n\r\nResearch Objective\r\nThe assistant will support the design and implementation of software functionalities for the WECAN Toolkit, which aims to enhance community wellbeing through participatory infrastructure planning and assessment.\r\n\r\nResponsibilities\r\n Attending and contributing to software requirements meetings with the project team and community stakeholders.\r\n Collaborating with users and project personnel to develop realistic personas (representative user profiles) in FigJam, detailing expected user behavior and software impact.\r\n Supporting the design of technical software requirements and helping develop interactive UI/UX prototypes using the Figma design platform.\r\n Assisting in infrastructure equity research and analysis, including interpreting findings and preparing presentation materials and scholarly documentation.\r\n Contributing to updates and enhancements of the SMU Infrastructure Dashboard.\r\n\r\nTo Apply\r\nPlease email Professor Barbara Minsker at minsker@smu.edu with your resume and a brief statement of interest describing your qualifications and motivation for applying.','Software Engineering (SE), Computer Science (CS)','','','','','','Civil & Environmental Engineering','On-campus','Proficiency in Java or Python; experience with Figma design tools; demonstrated ability to work collaboratively in team environments.','Same as above, with added experience in user-centered design or infrastructure-related projects.','','','',93,0,'Mon May 19 00:11:17 UTC 2025','Tue May 27 04:01:16 UTC 2025'),(15,'True',NULL,'updated','Cloud-Based Mobile Application Development','Developing a mobile application that supports caregivers working with children with neurological disorders.',0,0,1,'Joining our research team in developing a mobile application that supports caregivers working with children with neurological disorders. The app aims to provide real-time feedback and track progress using advanced natural language processing (NLP) and speech recognition technologies.','We are seeking a talented and motivated graduate student to join our research team in developing a mobile application that supports caregivers working with children with neurological disorders. The app aims to provide real-time feedback and track progress using advanced natural language processing (NLP) and speech recognition technologies.\r\n\r\nResponsibilities \r\n Develop and maintain cloud-based services using AWS for scalable data processing, storage, and deployment.\r\n Implement and test core features such as speech transcription, speaker identification, and natural language processing (NLP) using Python-based frameworks.\r\n Integrate Python back-end functionalities with the mobile front-end, including SWIFT for iOS as needed.\r\n Collaborate with an interdisciplinary team to refine app features based on caregiver feedback and usability testing.\r\n Generate automated progress reports for caregivers and behavior analysts.\r\n In-person participation in regular meetings and development activities at SMU.\r\n\r\nPreferred Qualifications\r\n Strong experience with AWS services (e.g., Lambda, S3, API Gateway, DynamoDB).\r\n Proficiency in Python, especially with speech and NLP libraries (e.g., SpeechRecognition, PyTorch, Hugging Face, spaCy).\r\n Familiarity with speaker diarization and audio processing tools (e.g., pyannote, WebRTC).\r\n Basic knowledge of SWIFT and iOS development for integration purposes.\r\n Interest in applying AI technologies to health and behavioral intervention domains.\r\n\r\nBenefits \r\n Opportunity to contribute to a high-impact research initiative focused on advancing interventions for children with autism and other neurological disorders.\r\n Competitive hourly compensation, with potential support for tuition and academic expenses depending on performance and funding availability.','AWS, Machine Learning, NLP','','','','','','Center for Digital and Human-Augmented Manufacturing (CDHAM)','On campus','Strong experience with AWS services. Proficiency in Python, especially with speech and NLP libraries.','Strong experience with AWS services. Proficiency in Python, especially with speech and NLP libraries.','','','',3,0,'Tue May 20 00:50:15 UTC 2025','Tue May 27 00:08:22 CDT 2025'),(16,'True',NULL,'closed','Test1',' Develop an AI-driven system to detect and mitigate cyber threats in real time using advanced machine learning models.',0,0,1,'This RA position focuses on building a robust, scalable cybersecurity detection framework using deep learning and behavioral analysis techniques.','The selected Research Assistant will work on a cutting-edge cybersecurity project aimed at developing an intelligent system capable of detecting anomalies and cyber threats across network traffic in real time. T