ning libraries (e.g., PyTorch, TensorFlow). \r\n Familiarity with or interest in generative models (e.g., Stable Diffusion, DALLE,). \r\n Background /interest in UI/UX design or human-computer interaction. \r\n Experience with sensors, Arduino/Raspberry Pi, or similar hardware is a plus. \r\n Creative mindset and interest in art/visual aesthetics a plus (especially for undergrads). \r\n\r\nBenefits: \r\n Gain hands-on experience in an innovative, interdisciplinary AI project. \r\n Work closely with faculty from both the Lyle School of Engineering and the Meadows School of Arts. \r\n Competitive stipend. \r\n Ideal opportunity for students interested in AI, HCI, or design-tech.','Python, machine learning, UI/UX','','','','','','Computer Science','on campus','SE, CS, ML,UI/UX','Experience with Python and machine learning libraries (e.g., PyTorch, TensorFlow); Familiarity with or interest in generative models (e.g., Stable Diffusion, DALLE,);  Background /interest in UI/UX design or human-computer interaction; Experience with sensors, Arduino/Raspberry Pi, or similar hardware is a plus; Creative mindset and interest in art/visual aesthetics a plus (especially for undergrads). ','','','',3,0,'Sun Aug 03 19:12:44 UTC 2025','Sun Aug 03 19:12:44 UTC 2025'),(40,'True',NULL,'closed','Software developer in the fall semester','We call for talented graduate students to contribute to SMU-Lyle-Sci-Hub program.',0,0,1,'CS Department developed an SMU-Lyle-Sci-Hub web portal to support scientific/business collaboration, knowledge sharing, and research between SMU and the local industry in the Dallas-Fort Worth Metropolitan Area. ','[Backgroud]\r\nCS Department is developing an SMU-Lyle-Sci-Hub web portal to link SMU with the local industry. Sci-Hub is powered by the most recent computer science techniques, including machine learning/deep learning, artificial intelligence, data mining, knowledge graph, semantic web, natural language processing, cloud computing, and software engineeri