 I am very happy to refine my skills further and to help expand Sci-Hubs capabilities.\nThank you for considering my application.','','Pan','Yiyou','yiyoup@smu.edu','7654099185','','','','','','','','','','',0,0,0,0,NULL,NULL,'Fri Apr 25 23:06:34 UTC 2025','True','pending'),(7,13,49,'RA','RA','A','A','A','','','A','A','A','','','','','','','',0,0,0,0,NULL,NULL,'Fri May 16 20:03:20 UTC 2025','True','open'),(8,10,49,'RA','a','a','A','A','','','A','A','A','','','','','','','',0,0,0,0,NULL,NULL,'Fri May 16 20:05:35 UTC 2025','True','pending'),(9,15,81,'Application for Cloud-Based Mobile Application Development RA Job','My name is Chenrui Zhao and I am currently a graduate student in SMU majoring computer\r\nscience. I am writing to apply for the Graduate Research Position in Department of Computer\r\nScience. My research interests lie particularly in statistics with AI, NLP and software\r\ndevelopment.\r\n\r\nMy academic records and research experiences have helped me develop necessary skills for this\r\nposition. I took ML in Python, Data Mining and Cloud Computing last semester and got both\r\nA. I have enrolled in NLP course this semester which I found myself deeply passionate about. I\r\nam making every effort to study edge-cutting materials and gaining a comprehensive\r\nunderstanding of this field.\r\n\r\nDuring my undergraduate studies, I participated in the University Student Internet+ Competition,\r\ngaining initial experience in app development. At the end of last year, in order to apply for a\r\nsimilar position at my university, I learned Swift language and have since become proficient\r\nin Xcode and SwiftUI, allowing me to develop simple apps independently.\r\n\r\nI previously worked as a research assistant at a national-level fruit and vegetable laboratory in\r\nChina, where I assisted graduate students in conducting an experiment that utilized AI to\r\nimprove processing methods, reducing the levels of harmful substances in the process. For my\r\nundergraduate thesis, I applied statistical methods to explore the optimal processing techniques\r\nfor a specific type of food.\r\n\r\nThank you for considering my application. I am looking forward to contributing to your research\r\nteam.','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Tue May 20 05:13:19 UTC 2025','True','open'),(10,14,81,'Application for SE Summer RA for WECAN','My name is Chenrui Zhao. I am writing to express my strong interest in the research assistant position for the WECAN Toolkit project. With a graduate background in Computer Science at SMU and experience in user-centered web application development, I am drawn to the opportunity to contribute to socially impactful research through technical means. In a recent project, I designed and implemented a web-based platform for storing, uploading, and analyzing social media content using a custom database and interactive interfacean experience that mirrors WECAN\'s goals. My past work also involved building machine learning models for text and image data, visualizing insights, and refining user interfaces during my SAP internship. I am particularly excited by the prospect of collaborating on requirements gathering and designing personas through FigJam or similar platforms. I look forward to potentially contributing my skills to this interdisciplinary initiative.','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Tue May 20 05:15:34 UTC 2025','True','open'),(11,10,77,'Aspiring Software Developer with Proven Research & Full-Stack Project Experience | Proficient in Java & Python | Passionate About AI and Knowledge Graphs','I am writing to express my strong interest in joining the SMU-Lyle-Sci-Hub project as a Software Developer. As a current graduate student in Computer Science at Southern Methodist University, with a solid research background and full-stack development experience, I am excited about the opportunity to contribute to this interdisciplinary and forward-thinking initiative.\r\nI completed my Bachelor\'s degree in Computer Science and Technology at Huaiyin Normal University, where I led several award-winning research and development projects. These included designing a novel infrared-visible image fusion algorithm (published and patented), building a WeChat mini program for intelligent image processing, and developing a Python-based classification system using BERT. These experiences have sharpened my skills in Python, Java, and machine learningtechnologies highly relevant to the Sci-Hub platform.\r\nWhat inspires me most about the SMU-Lyle-Sci-Hub project is its mission to integrate modern computer science methods like NLP, knowledge graphs, and AI into a collaborative research portal. I am especially motivated to apply my experience in software development and natural language processing while growing my skills in cloud-based architecture and JavaScript through real-world contribution.\r\nAs an SMU graduate student in Dallas, I am available to work 10 hours per week and eager to contribute meaningfully to this cutting-edge research platform. I believe my technical foundation, research mindset, and dedication to academic collaboration align well with the projects vision.\r\nThank you for considering my application. I would be honored to support the Sci-Hub development team and contribute to SMUs cross-disciplinary research efforts.\r\n','MSCS','Huang','Yongbin','yongbinh@smu.edu','9452094027','','','','','','','','','','',0,0,0,0,NULL,NULL,'Fri May 23 20:27:08 UTC 2025','True','open'),(12,21,49,'abc','apple, window, future, bottle, cloud, train, silence, forest, engine, whisper, knife, rabbit, signal, orange, circle, ladder, flower, thunder, mission, rocket, breeze, jungle, hammer, mirror, eagle, river, pocket, stone, tunnel, whisper, cable, lemon, garden, pencil, sunset, canyon, magic, tiger, blanket, school, violin, castle, island, wallet, planet, thunderstorm, cereal, shadow, spider, helmet, crown, anchor, compass, valle