 to all, avoiding a deepening digital divide. Balancing innovation with responsibility will determine how sustainable and equitable our future becomes in this fast-evolving digital age.','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 15:52:57 UTC 2025','True','open'),(14,22,49,'abc','abc','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 18:18:44 UTC 2025','True','pending'),(15,15,77,'Aspiring Software Developer with Proven Research & Full-Stack Project Experience | Proficient in Java & Python | Passionate About AI and Knowledge Graphs','I am writing to express my strong interest in joining the SMU-Lyle-Sci-Hub project as a Software Developer. As a current graduate student in Computer Science at Southern Methodist University, with a solid research background and full-stack development experience, I am excited about the opportunity to contribute to this interdisciplinary and forward-thinking initiative.\r\nI completed my Bachelor\'s degree in Computer Science and Technology at Huaiyin Normal University, where I led several award-winning research and development projects. These included designing a novel infrared-visible image fusion algorithm (published and patented), building a WeChat mini program for intelligent image processing, and developing a Python-based classification system using BERT. These experiences have sharpened my skills in Python, Java, and machine learningtechnologies highly relevant to the Sci-Hub platform.\r\nWhat inspires me most about the SMU-Lyle-Sci-Hub project is its mission to integrate modern computer science methods like NLP, knowledge graphs, and AI into a collaborative research portal. I am especially motivated to apply my experience in software development and natural language processing while growing my skills in cloud-based architecture and JavaScript through real-world contribution.\r\nAs an SMU graduate student in Dallas, I am available to work 10 hours per week and eager to contribute meaningfully to this cutting-edge research platform. I believe my technical foundation, research mindset, and dedication to academic collaboration align well with the projects vision.\r\nThank you for considering my application. I would be honored to support the Sci-Hub development team and contribute to SMUs cross-disciplinary research efforts.','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 18:34:16 UTC 2025','True','open'),(16,21,21,'test email','test email','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 15:07:50 CDT 2025','True','pending'),(17,25,49,'RA','ra','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 21:05:36 UTC 2025','True','open'),(18,26,49,'ra','ra','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 21:10:06 UTC 2025','True','pending'),(19,26,21,'test pdf have 13','test','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 21:20:34 UTC 2025','True','open'),(20,26,21,'test pdf have 13','test','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 21:31:31 UTC 2025','True','open'),(21,24,21,'test','test','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 21:32:21 UTC 2025','True','open'),(22,22,21,'endpoint','endpoint','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 21:33:49 UTC 2025','True','open'),(23,23,21,'testpdf','testpdf','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 21:41:01 UTC 2025','True','open'),(24,25,21,'test','test','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 21:45:25 UTC 2025','True','open'),(25,27,21,'test 13','test 13','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 22:01:42 UTC 2025','True','open'),(26,28,21,'no pdf','no pdf','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 22:05:05 UTC 2025','True','open'),(27,29,21,'test null','test null','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 17:10:00 CDT 2025','True','pending'),(28,29,49,'test','test','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon May 26 17:12:34 CDT 2025','True','pending'),(29,10,107,'Graduate Student with Web Development and Machine Learning Experience | RA Software Developer Applicant','Dear Professor Zhang,\r\n\r\nI am writing to express my interest in the Research Assistant position (Software Developer) for the SMU-Lyle-Sci-Hub program in the Department of Computer Science. I am currently a graduate student learning computer science at SMU with foundation in both web development and machine learning, my SMUID is 50153903, and I am eager to contribute my skills to this innovative, cross-disciplinary research platform.\r\n\r\nMy background includes coursework in *Machine Learning in Python (CS7324-001C-1252)*, where I gained hands-on experience with neural networks, deep learning, and convolutional neural networks (CNNs). In addition, I have practical experience with front-end technologies such as HTML, CSS, JavaScript, and the Vue.js framework. As part of my independent learning, I developed a complete ToDoList application using Vue.js and regularly use GitHub for version control and collaborative development.\r\n\r\nI am particularly drawn to the Sci-Hub projects integration of cutting-edge technologies such as AI, NLP, and knowledge graphs. With my technical skills and strong motivation to grow in a research-oriented environment, I believe I am well-prepared to support the continued development and deployment of this impactful platform.\r\n\r\nThank you for considering my application. I have attached my resume, transcript, and degree certificate for your review. I would be delighted to further discuss how I can contribute to the SMU-Lyle-Sci-Hub initiative.\r\n\r\nSincerely,  \r\nJunliang Lyu  \r\njunliangl@smu.edu  \r\n1-469-861-5959\r\n','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Fri May 30 03:33:29 UTC 2025','True','open'),(30,14,77,'Aspiring Software Developer with Proven Research & Full-Stack Project Experience | Proficient in Java & Python','I am writing to express my strong interest in joining the SMU-Lyle-Sci-Hub project as a Software Developer. As a current graduate student in Computer Science at Southern Methodist University, with a solid research background and full-stack development experience, I am excited about the opportunity to contribute to this interdisciplinary and forward-thinking initiative. I completed my Bachelor\'s degree in Computer Science and Technology at Huaiyin Normal University, where I led several award-winning research and development projects. These included designing a novel infrared-visible image fusion algorithm (published and patented), building a WeChat mini program for intelligent image processing, and developing a Python-based classification system using BERT. These experiences have sharpened my skills in Python, Java, and machine learningtechnologies highly relevant to the Sci-Hub platform. What inspires me most about the SMU-Lyle-Sci-Hub project is its mission to integrate modern computer science methods like NLP, knowledge graphs, and AI into a collaborative research portal. I am especially motivated to apply my experience in software development and natural language processing while growing my skills in cloud-based architecture and JavaScript through real-world contribution. As an SMU graduate student in Dallas, I am available to work 10 hours per week and eager to contribute meaningfully to this cutting-edge research platform. I believe my technical foundation, research mindset, and dedication to academic collaboration align well with the projects vision. Thank you for considering my application. I would be honored to support the Sci-Hub development team and contribute to SMUs cross-disciplinary research efforts.','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Sun Jun 08 02:35:00 UTC 2025','True','open'),(31,35,91,'Software engineering graduate student applying for App developer','Dear Professor,\r\n\r\nMy name is Linwei Li and I am a graduate student in Software Engineering program of SMU, writing to apply for the the iOS App developer.\r\n\r\nI have three years of experience in Android Telephony Framework development and familiar with Java programming language.\r\nIn my previous job, I was responsible for independently customizing the Telephony Framework for Android devices, including requirements analysis, implementation, and bug fixing. I also gained experience working with app crash, app interface and UI-related issues, which gave me a broader understanding of mobile development.\r\n\r\nEven though I haven\'t worked as iOS app developer, I believe my skills and experience in Android system development can make me quickly become productive in iOS app development.\r\nI would be happy to contribute in any way I can and am always eager to learn and face new challenges.\r\n\r\nThank you for considering my application. I would welcome the opportunity to further discuss how I can contribute.\r\n\r\nSincerely,\r\nLinwei','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Tue Jun 17 21:32:08 UTC 2025','True','open'),(32,41,91,'Application for RA Position: Software Developer for SMU-Lyle-Sci-Hub','Dear Professor Zhang,\r\n\r\nMy name is Linwei Li and I am a graduate student in Software Engineering at SMU. I have strong interest in the RA position for software development in the SMU-Lyle-Sci-Hub project this fall semester.\r\n\r\nWith prior experience in Android systems development for 2 years and a strong foundation in Java, I think my ability could contribute to this project. I just took the course of cloud computing and learn a lot about AWS. I am particularly interested in this opportunity because it allows me to apply what Ive learned in class to a real-world, impactful project.\r\nI am eager to learn and adapt to new technologies and frameworks as required like JavaScript.\r\n\r\nThank you for considering my application. I would be thrilled to contribute to the SMU-Lyle-Sci-Hub platform.\r\n\r\nBest regards,\r\nLinwei','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Sun Aug 03 20:53:59 UTC 2025','True','open'),(33,42,112,'MS in Datacenter Systems Engineering | Hands-on Cloud & ML Projects | Ex-Tesla | Passionate About Human-Centered AI','Dear Dr. Alaeddini,\r\n\r\nI am writing to express my interest in the AI-Driven Personalized Home Environment System research opportunity. As a Masters student in Datacenter Systems Engineering at SMU with a strong foundation in cloud computing, machine learning, and data analytics, I am excited by the interdisciplinary nature of this project.\r\n\r\nThrough hands-on labs in AWS cloud deployment and intelligent speech processing, Ive gained experience with Python, Keras, and model evaluation techniques such as PCA and UMAP. My background also includes three years at Tesla as a Sales Technical Advisor, where I honed cross-functional communication and data analysis skills using Excel and internal CRM tools.\r\n\r\nI am particularly drawn to this roles combination of environmental sensors, generative AI, and user-centered designareas Im eager to explore further. I would welcome the opportunity to contribute to your team and learn from both the engineering and arts perspectives.\r\n\r\nThank you for considering my application. Ive attached my resume and would be happy to discuss further at your convenience.\r\n\r\nBest regards,\r\nJingwei Chang\r\njingweic@smu.edu | (+1) 469-597-9338','','','','','','','','','','','','','','','',0,0,0,0,NULL,NULL,'Mon Aug 18 13:28:18 UTC 2025','True','open');
