INSERT INTO `technology` VALUES (1,'Alexa-Like Virtual Research Assistant','MATA, a virtual research assistant powered by artificial intelligence, turns NASAs earth science data into useable knowledge for scientists.','The technology is specifically designed for searches that are geospatial and time-aware. In addition, it continuously integrates community intelligence and can evolve as new research is developed.  ','Improving natural disaster predictions using AI  Predicting natural disasters and creating climate models involve processing an enormous amount of data. Zhangs work is dedicated to developing intelligent systems that help speed up processing using machine learning.   For example, MATA is designed to pull stored data from dozens of satellites related to hurricanes, floods, dust storms, heat waves, power outages, and more. When a user asks a question, MATA finds the answer by pulling the appropriate data and conducting additional computations as needed. The answer is then provided conversationally.  While NASA makes Earth science data available on the web, MATA provides the computing to turn the data into usable knowledge. ','AI, CS','Alexa-Like Virtual Research Assistant','','Computer Science',NULL,NULL,'',0,0,0,0,NULL,NULL,'True',1);
